Currently timestamps (int64) are decoded as objects with "low", "high", and "unsigned" properties.
This PR changes this behavior.

Before:
```
{
    timestamp: {
        low: 1667665624,
        high: 0,
        unsigned: true
    }
}
```
After:
```
{
    timestamp: 1667665624
}
```

